import React, { Component  } from "react";

export default class CreateExercises extends Component{

    // creating a constructor
    constructor(props){
        super(props);

        this.state = {
            username: '',
            description: '',
            duration: 0,
            date: new Date(),
            users: [] // state is how you create variables in react, whenever you update state, your page will update with new values
        }
    }

    onChangeUsername(e){
        //always use set state method in react
        this.setState({
            usernae: e.target.value
        })
    }
    render(){
        return (
            <div>
                <p>You are on the Create Exercises component!</p>
            </div>
        )
    }
}
